let bookSelected;
function selectBook(book) {
  bookSelected = listBookSelect[parseInt(book)];
  let removeBookParent = document.getElementById("choose-Book");
  let removeBookChild = document.getElementsByClassName("book");
  let rbcn = removeBookChild.length
  let n = 0;
  for (let b = 0; b < rbcn; b++) {
    if (b != book) {
      removeBookParent.removeChild(removeBookChild[n]);
    } else {
      n = 1;
    }
  }
  document.getElementById("book-title-select").innerText = "LIVRO SELECIONADO";
  document.getElementById("center-book").style.width = "50%"
  //-----------removendo onclick--------//
  document.getElementById(`book-${book}`).setAttribute("onclick", "");
  document.getElementById(`book-${book}`).setAttribute("class", "bookSelected");
  selectRandomPage();
}

let pageSelected;
function selectRandomPage() {
  let pageNumberSelected = 0;

  pageLoop(pageNumberSelected)
  function pageLoop(i) {
    if (i <= 10) {
      pageNumberSelected = Math.floor(Math.random() * 10)
      document.getElementById("page-select-text").innerText = bookSelected[pageNumberSelected].textopag;
      i++
      pageLoop(i);
    }
  }
  pageSelected = bookSelected[pageNumberSelected];
  document.getElementById("page-statistics").innerHTML = `<p id="pag-letter-random-select">TODAS AS LETRAS:&nbsp; &nbsp;<span id="pageId">${bookSelected[pageNumberSelected].textopag.length}</span></p>`;
  document.getElementById("pageId").innerText = pageNumberSelected;
  document.getElementById("pag-letter-random-select").hidden = false;
  document.getElementById("separate-line-2").hidden = false;

  selectRandomLetter();
}

