let alphabetObj = [];
const alphabetArr = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz";
let letterRandomSelected;
function selectRandomLetter() {
  letterRandomSelected = alphabetArr[Math.floor(Math.random() * alphabetArr.length)]; //O jogo sorteia uma letra do alfabeto.
  document.getElementById("letterId").innerText = letterRandomSelected;
  document.getElementById("letter-select").hidden = false;
  document.getElementById("qtdPlayers").hidden = false;

  console.log("letterRandomSelected: ");
  console.log(letterRandomSelected);
}

let numPlayers;
function selectQtdPlayers() {
  numPlayers = document.getElementById("playersId-value").value;
  console.log(numPlayers);
  if (numPlayers != "" && numPlayers != "0" && numPlayers >= 1) {

    document.getElementById("playersId-value").setAttribute("disabled", "disabled");
    document.getElementById("playersId-button").setAttribute("disabled", "disabled");
    playerHtml();
    function playerHtml() {
      document.getElementById("players").hidden = false;
      for (let i = 0; i < numPlayers; i++) {
        document.getElementById("players").innerHTML +=
        `<div class="playerId">
        <br><p>Jogador nº ${i + 1}</p><br>
        <input type="number" id="playerId-letter-value-${i + 1}" class="text-player" minlength="1" maxlength="1"><br>
        <input type="button" id="playerId-button-${i + 1}" class="text-player-button" value="ESCOLHER" onclick="suggestionPlayer(${i + 1})">
        </div>`
      }
    }
  } else {
    console.log("ESCOLHER UMA QUANTIDADE DE JOGADORES")
  }

}

let playerSuggestion = [];
function suggestionPlayer(playerIdSuggestionSelected) {
  document.getElementById(`playerId-letter-value-${playerIdSuggestionSelected}`).setAttribute("disabled", "disabled");
  document.getElementById(`playerId-button-${playerIdSuggestionSelected}`).setAttribute("disabled", "disabled");
  
  document.getElementById(`playerId-letter-value-${playerIdSuggestionSelected}`).value == "" ? document.getElementById(`playerId-letter-value-${playerIdSuggestionSelected}`).value = "0": "";
  playerSuggestion[playerIdSuggestionSelected] = document.getElementById(`playerId-letter-value-${playerIdSuggestionSelected}`).value == "" ? 0: document.getElementById(`playerId-letter-value-${playerIdSuggestionSelected}`).value;

  checkPlayersPlayed()
}

function checkPlayersPlayed() {
  let playerPlayed = 0;
  for (let i = 0; i < playerSuggestion.length; i++) {
    if (playerSuggestion[i] != undefined) {
      playerPlayed += 1
      console.log("playerSuggestion : " + playerSuggestion.length);
      console.log("playerPlayed : " + playerPlayed);
    }
    if (numPlayers == playerPlayed) {
      console.log("PASS");

      play();
    }
  }
}

function play() {
  document.getElementById("center-book").style.width = "50%";
  document.getElementById("play").hidden = false;
  document.getElementById("play").style.width = "50%";
  document.getElementById("play").style.visibility = "visible";
}

let textBookPage = "";
function playStart() {
  document.getElementById("play-button").setAttribute("disabled", "disabled");
  let textBookPageSelected = pageSelected.textopag;
  for (l of textBookPageSelected) {
    if (alphabetArr.indexOf(l) == -1) {
    } else {
      if (alphabetObj[alphabetArr.indexOf(l)] == undefined)
        alphabetObj[alphabetArr.indexOf(l)] = 1;
      else {
        alphabetObj[alphabetArr.indexOf(l)] += 1;
      }
    }
  }
  console.log(alphabetObj);
  letterClassification();
}

let letterRandomSelectedQtd = 0;
function letterClassification() {
  for (let i = 0; i < alphabetArr.length; i++) {
    if (alphabetArr[i] == letterRandomSelected) {
      letterRandomSelectedQtd = alphabetObj[alphabetArr.indexOf(alphabetArr[i])];
    }
  }
  // se não tiver nenhuma letra na pagina define letter como 0
  letterRandomSelectedQtd == undefined ? letterRandomSelectedQtd = 0 : "";
  result();
}

function result() {
  let playerSuggestionWinner = []
  let maisProximo;
  let ers = 0;

  // que acertou ou mais proximo do resultado.
  if (playerSuggestion.length != 0) {
    maisProximo = playerSuggestion.reduce(function (anterior, corrente) {
      return (Math.abs(corrente - letterRandomSelectedQtd) < Math.abs(anterior - letterRandomSelectedQtd) ? corrente : anterior);
    });
  }

  // gerando html do(s) ganhador(es).
  playerSuggestion.forEach(findWinner);
  function findWinner(value, index) {
    if (value == maisProximo) {
      playerSuggestionWinner += `<br>JOGADOR  Nº ${index}  -  Quantidade escolhida:  ${playerSuggestion[index]}`;
      ers++
      console.log(value + " - " + index);
    }
  }

  document.getElementById("result").innerHTML = `<span class="letter-select">LETRA SELECIONADA: <span id="letterId">${letterRandomSelected}</span></span><br><span class="letter-select">QUANTIDADE: <span id="letterId">${letterRandomSelectedQtd}</span></span><br><span class="letter-select">GANHADOR${ers > 1 ? "ES" : ""} :&nbsp;<span id="winner"></span></span>&nbsp;`;
  document.getElementById("winner").innerHTML = playerSuggestionWinner;

  letterMark();
}

function letterMark() {
  let textMarked = "";

  for (t of pageSelected.textopag) {
    if (t == letterRandomSelected) {
      textMarked = textMarked.concat(`<span class=\"letter-maked\">${letterRandomSelected}</span>`);
      console.log("letra atual: " + t)
    } else {
      textMarked = textMarked.concat(t);
    }
  }
  document.getElementById("page-select-text").innerHTML = textMarked;
}




